import React from "react";
import Header from './Layout/AppHeader';
import Footer from './Layout/AppFooter';
import SearchFilter from "./SearchFilter";
import Demo from "./Demo";
// import image from '../Assets/bgImage'

const Home = () => {
    return (
        <>
            <Header />
            <SearchFilter/>
            <Demo/>
            <Footer />
        </>
    )
}

export default Home;
